const Div  = () => {

    let data="Hello World";
    const state =useState();
    
 const [Countes , cDatas] = useState(data);

 const cdataa = () =>{
    var data ="Rana Wadaa Toppoo Walaa";
    cDatas(data);
    
 };


return(
     <>
        <h1>{Countes}</h1>
        <button onMouseEnter={cdataa}></button>
     </>
);
}
export default Div;
